import styled from 'styled-components';

const Logo = styled.div`
  width: 100%;
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 1.6rem;
  padding-left: 7rem;

  img {
    width: 12rem;
  }
`;

export default Logo;
